package com.ufgov.zc.server.zc.publish.impl;import java.util.List;import com.ufgov.zc.common.system.RequestMeta;import com.ufgov.zc.common.system.dto.ElementConditionDto;import com.ufgov.zc.common.zc.model.DataExchange;import com.ufgov.zc.common.zc.model.DataExchangeLog;import com.ufgov.zc.common.zc.model.DataExchangeRedo;import com.ufgov.zc.common.zc.publish.IDataExchangeServiceDelegate;import com.ufgov.zc.server.zc.service.IDataExchangeService;public class DataExchangeServiceDelegate implements IDataExchangeServiceDelegate {  private IDataExchangeService dataExchangeService;  public List getDataExchangeLogs(ElementConditionDto dto, RequestMeta meta) {    return dataExchangeService.getDataExchangeLogs(dto);  }  public DataExchangeLog save(DataExchangeLog log, RequestMeta requestMeta) {    return dataExchangeService.save(log);  }  public DataExchange save(DataExchange de, RequestMeta requestMeta) {    return dataExchangeService.save(de);  }  public List getAllDataExchange(DataExchange de, RequestMeta requestMeta) {    return dataExchangeService.getAllDataExchange();  }  public List getDataExchangeRedoList(ElementConditionDto dto, RequestMeta meta) {    return dataExchangeService.getDataExchangeRedos(dto);  }  public void saveDataExchangeRedo(DataExchangeRedo redo, RequestMeta meta) {    dataExchangeService.saveRedo(redo);  }  public void updateDataExchangeRedoIsExported(DataExchangeRedo redo, RequestMeta meta) {    this.dataExchangeService.updateDataExchangeRedoIsExported(redo);  }  public IDataExchangeService getDataExchangeService() {    return dataExchangeService;  }  public void setDataExchangeService(IDataExchangeService dataExchangeService) {    this.dataExchangeService = dataExchangeService;  }  public List getDataExchangeRedoListByLikeRecordID(ElementConditionDto redoDto, RequestMeta meta) {    return this.dataExchangeService.getDataExchangeRedosByLikeRecordID(redoDto);  }}